INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1, 11, 0, 1034501, 0, 1, "わあ……素敵なケーキね！\nえ？　キミが作ったの？\nすごいじゃない！", 4, 1034501040, "", 103411);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", 91, "", 1034501, "", "", "", "", 1034501041, "", 0);
