INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1, 11, 0, 1052501, 0, 1, "少しでもお返ししたいけど……\nあなたは何かしてほしいことはある？\nえ？　私の誕生日だから私が\n喜んでくれたらうれしい……？", 5, 1052501046, "", 105211);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", 91, "", 1052501, "", "", "", "", 1052501047, "", 0);
