INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1, 11, 0, 1070501, 0, 1, "ふむ、よい趣向ですね。\n敬うべき相手を忘れず、恩を忘れず、\n健勝を祝う宴を開く……\n礼節を弁えた人間は好きですよ。", 4, 1070501040, "", 107011);
