INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES (1, 11, 0, 1070501, 0, 1, "しかし一時には\n赤子同然だった貴方が\nここまで成長したこと……\nとても喜ばしく思います。", 5, 1070501043, "", 107011);
INSERT INTO `v1_04dfbb64c543c043bfdb79cb250d2e365569b2ddd6e12f765e88725476cc52b4` VALUES ("", 91, "", 1070501, "", "", "", "", 1070501044, "", 0);
